Thanks to Republican obstructionism in Congress, the nation
was forced into the sequester last Friday -- a series of
automatic and destructive budgets cuts that you and your
neighbors are just beginning to feel.=20

In the face of these devastating cuts, House Speaker John
Boehner went on TV and said, "I don't know whether it's
going to hurt the economy or not ... I don't think anyone
quite understands how the sequester is really going to work."

Really? We're not talking about some abstract numbers on a
piece of paper -- this is real.=20

The sequester will cut 10,000 teaching jobs, 70,000 spots
for preschoolers in Head Start, $43 million for food
programs for seniors, $35 million for local fire
departments, and access to nutrition assistance for over
half a million women and their families.

And the reason congressional Republicans let these cuts go
into effect is because they simply wouldn't support closing
tax loopholes for millionaires and billionaires -- for
things like yachts and corporate jets. I wish I were kidding.

More than 340,000 OFA supporters have added their names to
support President Obama's balanced plan and call on
congressional Republicans to take action to stop the
sequester budget cuts right now.

Add your name, today, and join them:

http://my.barackobama.com/Tell-the-GOP-to-Act

Thanks, and keep it up.

Stephanie


