Read the Latest Episode of "PaaS Under the Hood"
How to Optimize the Memory Usage of Your Apps

As a PaaS that bills Live apps based on hourly (RAM) memory reservation, o=
ur engineering team regularly fields questions about minimizing memory con=
sumption and costs.

in this post, J=C3=A9r=C3=B4me Petazonni offers a no-fluff guide to Memory=
 Management. He explains the many types of memory cloud apps consume and h=
ow one might measure and optimize the memory usage of those services.

(Read Episode 6 on our blog) http://blog.dotcloud.com/how-to-optimize-the-=
memory-usage-of-your-apps
-------------------------------------------------

Customer Spotlights
Knowsis, TerseTag  &amp; GiftOpera

We continue to highlight dotCloud customers doing amazing things. But this=
 month we decided to switch up the format and interview our customers dire=
ctly.

Knowsis
Analytics for Traders
UK-based Knowsis extracts value from social media chatter to give traders=
 a method to decipher trends in the equity and futures market using Big Da=
ta. Knowsis uses machine learning and natural language processing to analy=
ze content as it is posted to online social media services (Twitter, Faceb=
ook etc), blogs, forums and news sites. They then aggregate the analyzed c=
ontent into a set of defined metrics which we can provide via our API.
http://blog.dotcloud.com/knowsis-big-data-for-traders

TerseTag
The Persistent Hashtag for Anything
TerseTag is a web-based system for creating persistent hashtags that invok=
e a specific call to action.   Terse tags can take the form of a hashtag o=
r a QR code.   A terse tag can be a memorable, one word tag, or a QR code=
 which can be scanned with a smartphone scanner sending the users to a lin=
k to additional information.  Essentially, a link between the physical and=
 digital world.
http://blog.dotcloud.com/175296013

GiftOpera
Launched in 12 weeks - Giving Online Gift-Giving a Makeover
GiftOpera takes a community approach towards gift-giving so that groups of=
 people can collaborate and share the costs of a group gift. By integratin=
g with Facebook, GiftOpera pulls important dates like anniversaries and bi=
rthdays using profile data.Users can bookmark gifts and designate them to=
 specific people and occasions and then get reminders about the occasion a=
s the event gets closer.
http://blog.dotcloud.com/giftopera-and-dotcloud-gift-giving-made-over

